                linkSrc={'https://ayronman99.github.io/Random-Qoute-Generator/'}
                classRef={'projitem'}
                imgSrc={RQG}
                altInfo={'test alt'}
                itemDesc={'Random Quote Generator'}
                />
                <ProjContainer
                linkSrc={'https://ayronman99.github.io/Random-Qoute-Generator/'}
                classRef={'projitem'}
                imgSrc={RQG}
                altInfo={'test alt'}
                itemDesc={'Random Quote Generator'}
                />
            </article>
            <ReactPaginate
                    previousLabel={'⠀'}
                    nextLabel={'⠀'}
                    pageCount={pagination}
                    onPageChange={clickToChange}
                    containerClassName={'pagination'}
                    disabledClassName={'disabled'}
                    activeClassName={'activepage'}
                />
        </div>
    )
}


const ProjContainer = ({classRef, imgSrc, itemDesc, altInfo, linkSrc}) => {
    return (
        <div className={classRef}>
         <a href={linkSrc} 
            target="_blank"
            rel='noreferrer'
         >
                <img 
                src={imgSrc} 
                alt={altInfo}></img>
                <div className='caption'>
                    {itemDesc}
                    </div>
         </a>     
        </div>
    )
}


export default ProjectWorks;
